import React from "react";

function ChannelList({ currentChannel, onSelect }) {
  const channels = ["general", "gaming", "voice"];

  return (
    <div style={{ width: 200, background: "#2f3136", color: "#fff", padding: 20 }}>
      <h3>Channels</h3>

      {channels.map((ch) => (
        <div
          key={ch}
          onClick={() => onSelect(ch)}
          style={{
            padding: "8px 0",
            cursor: "pointer",
            fontWeight: currentChannel === ch ? "bold" : "normal",
          }}
        >
          #{ch}
        </div>
      ))}
    </div>
  );
}

export default ChannelList;
